INSERT INTO `xswshop_product` VALUES (1,'0-3岁婴幼儿牙刷（妈妈帮宝宝刷）','./p_1_img.png','./p_1_img_detail.png','<p style=\"margin-left:21pt\"><strong>产品介绍</strong></p>\r\n\r\n<p>小狮王是较早将分年龄段儿童牙刷概念引入中国的品牌，更是创新的研发了在0-3岁宝宝尚不会自己刷牙的阶段，为&ldquo;妈妈帮宝宝刷&rdquo;专门设计的牙刷。</p>\r\n\r\n<p>6个月左右，宝宝开始长乳牙，妈妈就可以开始帮宝宝清洁牙齿。&ldquo;小狮王婴幼儿牙刷（0-3岁）妈妈辅助&rdquo;刷头的尺寸正是根据该年龄段幼儿的口腔特点设计，且考虑到由于是&ldquo;妈妈帮宝宝刷&rdquo;，超小的刷头才能满足灵活控制的需求；刷毛柔软纤细，在保护宝宝乳牙形成期稚嫩牙龈的同时，加强清洁由于食用奶制品和泥状的辅食残留附着在宝宝牙齿上的牙垢，减少奶瓶龋等情况的发生。</p>\r\n\r\n<p style=\"margin-left:21pt\"><strong>爸爸妈妈要注意</strong></p>\r\n\r\n<p>&ldquo;小狮王超软细毛婴幼儿牙刷&rdquo;是由创始于1891年的日本狮王出品的，以超过120年的传承经验和领先科技，诚挚为您的孩子提供安全优质的口腔护理产品。</p>\r\n\r\n<p>建议务必培养孩子养成&ldquo;每天刷牙2次&nbsp;每次刷牙3分钟&rdquo;的好习惯。</p>\r\n\r\n<p>&ldquo;妈妈帮宝宝刷&rdquo;的时候，使用方法很重要！请务必参考下图中的使用方法，帮宝宝清洁牙齿，请务必轻柔温柔的对待，以免弄痛宝宝，造成不愿刷牙的心理阴影。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/uploads/2015/05/22/p_1_intro.png\" style=\"height:254px; width:542px\" />&nbsp;</p>\r\n\r\n<p>一般建议每三个月必须更换一次牙刷，为确保宝宝的口腔健康，家长可根据使用状况提前进行更换，</p>\r\n\r\n<p>&ldquo;小狮王超软细毛婴幼儿牙刷&rdquo;配合&ldquo;小狮王木糖醇儿童牙膏（有草莓、葡萄、桔子三种口味）&rdquo;使用，安全防蛀+呵护宝贝稚嫩牙龈一步到位。儿童牙膏一般不适合吞咽，若低龄儿童尚未学会将刷扫后的牙膏泡沫吐出，建议微量使用牙膏或暂时先使用盐水配合小狮王超软细毛婴幼儿牙刷清洁牙齿更为安全，同时务必养成吃完东西(特别是含糖食物&nbsp;)后，清水漱口的好习惯，防止龋齿或牙龈问题的产生。</p>\r\n\r\n<p>每一个孩子都是天使，希望小狮王能够一直陪伴天使们健康快乐的成长！</p>\r\n',2,'http://detail.tmall.com/item.htm?spm=a1z10.3-b.w4011-9436619662.71.3lhvuf&id=38102520480&rn=573dcb9e460689be1392dfd24c56ae89&abbucket=16','http://item.yhd.com/item/27348525?tc=3.0.5.27348525.10&tp=51.%E5%B0%8F%E7%8B%AE%E7%8E%8B.124.0.72.KpHxzD2-10-9H9i4','./p_1_title.png','http://item.jd.com/1140382.html','#c5e1eb',1,'0.0.1'),(2,'1.5-3婴幼儿牙刷（宝宝自己刷）','./p_2_img.png','./p_2_img_detail.png','<p style=\"margin-left:21pt\"><strong>&bull;产品介绍</strong></p>\r\n\r\n<p>小狮王是较早将分年龄段儿童牙刷概念引入中国的品牌，更是创新的研发了在0-3岁宝宝尚不会自己刷牙的阶段，为&ldquo;妈妈帮宝宝刷&rdquo;专门设计的牙刷。</p>\r\n\r\n<p>6个月左右，宝宝开始长乳牙，妈妈就可以开始帮宝宝清洁牙齿。&ldquo;小狮王婴幼儿牙刷（0-3岁）妈妈辅助&rdquo;刷头的尺寸正是根据该年龄段幼儿的口腔特点设计，且考虑到由于是&ldquo;妈妈帮宝宝刷&rdquo;，超小的刷头才能满足灵活控制的需求；刷毛柔软纤细，在保护宝宝乳牙形成期稚嫩牙龈的同时，加强清洁由于食用奶制品和泥状的辅食残留附着在宝宝牙齿上的牙垢，减少奶瓶龋等情况的发生。</p>\r\n\r\n<p style=\"margin-left:21pt\">l&nbsp;爸爸妈妈要注意：</p>\r\n\r\n<p>&ldquo;小狮王超软细毛婴幼儿牙刷&rdquo;是由创始于1891年的日本狮王出品的，以超过120年的传承经验和领先科技，诚挚为您的孩子提供安全优质的口腔护理产品。</p>\r\n\r\n<p>建议务必培养孩子养成&ldquo;每天刷牙2次&nbsp;每次刷牙3分钟&rdquo;的好习惯。</p>\r\n\r\n<p>&ldquo;妈妈帮宝宝刷&rdquo;的时候，使用方法很重要！请务必参考下图中的使用方法，帮宝宝清洁牙齿，请务必轻柔温柔的对待，以免弄痛宝宝，造成不愿刷牙的心理阴影。</p>\r\n\r\n<p><img src=\"/media/uploads/2015/05/27/intro_2.jpg\" style=\"height:98px; width:205px\" />&nbsp;</p>\r\n\r\n<p>一般建议每三个月必须更换一次牙刷，为确保宝宝的口腔健康，家长可根据使用状况提前进行更换，</p>\r\n\r\n<p>&ldquo;小狮王超软细毛婴幼儿牙刷&rdquo;配合&ldquo;小狮王木糖醇儿童牙膏（有草莓、葡萄、桔子三种口味）&rdquo;使用，安全防蛀+呵护宝贝稚嫩牙龈一步到位。儿童牙膏一般不适合吞咽，若低龄儿童尚未学会将刷扫后的牙膏泡沫吐出，建议微量使用牙膏或暂时先使用盐水配合小狮王超软细毛婴幼儿牙刷清洁牙齿更为安全，同时务必养成吃完东西(特别是含糖食物&nbsp;)后，清水漱口的好习惯，防止龋齿或牙龈问题的产生。</p>\r\n\r\n<p>每一个孩子都是天使，希望小狮王能够一直陪伴天使们健康快乐的成长！</p>\r\n',2,'http://detail.tmall.com/item.htm?spm=a1z10.3-b.w4011-9436619662.76.3lhvuf&id=38046941613&rn=573dcb9e460689be1392dfd24c56ae89&abbucket=16','http://item.yhd.com/item/27348527?tc=3.0.5.27348527.8&tp=51.%E5%B0%8F%E7%8B%AE%E7%8E%8B.124.0.55.KpHxzD2-10-9H9i4','./p_2_title.png','http://item.jd.com/1140381.html','#fff700',2,'0.0.1');
